        name: "A5E.encounterElements.miringGround",
        description: "<p>Sludge, tar, or sufficiently deep and sticky mud can provide real danger to creatures caught in them. Miring ground is difficult terrain. In addition, when a creature starts its turn in miring ground, it begins to sink and makes an Athletics check (DC 12 + 2 per round spent in the area) to continue moving. On a failure, its Speed is reduced by 10 feet. When this reduces a creatures Speed to 5 feet or less it begins sinking 1 foot deeper into the miring ground at the end of each of its turns. A sinking creature can be freed with an Athletics check equal to the DC of its last failed check against the miring ground. A sinking creature that becomes submerged begins suffocating if it is unable to hold its breath. Any creature trying to aid a sinking creature must have a solid surface to stand on or a fly speed, but can use ropes or similar means to do so at a distance.</p>",
